void display_score_on_hex(int num) {
  int i;
  int display[4];

  int digit;

  for (i = 0; i < 4; i++) {
    digit = num % 10;
    num /= 10;
    display[i] = hex_digits[digit];
  }
  *(hexPtr) = (display[3] << 24) | (display[2] << 16) | (display[1] << 8) | display[0];
}

void plot_pixel(int x, int y, short int line_color) {
  volatile short int *one_pixel_address;

  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
  *one_pixel_address = line_color;
}

void clear_screen() {
  int y, x;
  for (x = 0; x < 320; x++)
    for (y = 0; y < 240; y++) plot_pixel(x, y, 0);
}

void draw_sky(short int color) {
  for (int x = 0; x < 320; x++) {
    for (int y = 0; y < 60; y++) {
      plot_pixel(x, y, color);
    }
  }
}

void draw_desert(short int color) {
  for (int x = 0; x < 320; x++) {
    for (int y = 60; y < 240; y++) {
      plot_pixel(x, y, color);
    }
  }
}

void draw_road(short int color) {
  int x_left = 130;
  int x_right = 190;

  int count = 1;

  for (int y = 60; y < 240; y++) {
    for (int x = x_left; x < x_right; x++) {
      plot_pixel(x, y, color);
    }

    if (count != 2) {
      x_left--;
      x_right++;
      count++;
    } else {
      count = 0;
    }
  }
}

void draw_lanes(short int color) {
  int x_left = 155;
  int x_right = 165;

  int lane_height = 20;  // Height of each lane mark
  int gap_height = 20;   // Height of gap between markings
  int total_pattern = lane_height + gap_height;

  for (int y_base = lane_y; y_base < 240; y_base += total_pattern) {
    for (int y = y_base; y < y_base + lane_height && y < 240; y++) {
      if (y >= 60) {  // Only draw if in the road area
        for (int x = x_left; x <= x_right; x++) {
          plot_pixel(x, y, color);
        }
      }
    }
  }

  lane_y = (lane_y + 1) % total_pattern;
}

void draw_taxi(int x, int y, const int taxi[68][80]) {
  // Draw taxi pixel by pixel from the array
  for (int i = 0; i < 68; i++) {
    for (int j = 0; j < 80; j++) {
      // Only draw non-transparent pixels (65535 is transparent)
      if (taxi[i][j] != 65535) {
        // Make sure the pixel is within screen boundaries
        if ((x + j) >= 0 && (x + j) < 320 && (y + i) >= 0 && (y + i) < 240) {
          plot_pixel(x + j, y + i, taxi[i][j]);
        }
      }
    }
  }
}

void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // Base address
  int status;

  *(pixel_ctrl_ptr) = 1;  // Start synchronization process, write 1 into front buffer address reg
  status = *(pixel_ctrl_ptr + 3);  // Read status reg

  while ((status & 0x01) != 0) {  // Polling loop waiting for S bit to go to 0
    status = *(pixel_ctrl_ptr + 3);
  }  // Polling loop/function exits when status bit goes to 0
}

void erase_taxi(int x, int y, const int taxi[68][80]) {
  // Erase taxi pixel by pixel
  for (int i = 0; i < 68; i++) {
    for (int j = 0; j < 80; j++) {
      // Only erase non-transparent pixels
      if (taxi[i][j] != 65535) {
        // Make sure the pixel is within screen boundaries
        if ((x + j) >= 0 && (x + j) < 320 && (y + i) >= 0 && (y + i) < 240) {
          plot_pixel(x + j, y + i, 0xA493);  // Erase to road color
        }
      }
    }
  }
}

void draw_scaled_roadClosure(int x, int y, const int roadClosure[57][80], double scale) {
  int scaled_x, scaled_y;
  for (int i = 0; i < 57; i++) {
    for (int j = 0; j < 80; j++) {
      scaled_x = x + (int)(j * scale);
      scaled_y = y + (int)(i * scale);
      // Only draw non-transparent pixels (65535 is transparent)
      if (roadClosure[i][j] != 65535) {
        // Make sure the pixel is within screen boundaries
        if ((x + j) >= 0 && (x + j) < 320 && (y + i) >= 0 && (y + i) < 240) {
          plot_pixel(scaled_x, scaled_y, roadClosure[i][j]);
        }
      }
    }
  }
}

void erase_scaled_roadClosure(int x, int y, const int roadClosure[57][80], double scale) {
  for (int i = 0; i < 57; i++) {
    for (int j = 0; j < 80; j++) {
      int scaled_x = x + (int)(j * scale);
      int scaled_y = y + (int)(i * scale);
      // Only draw non-transparent pixels (65535 is transparent)
      if (roadClosure[i][j] != 65535) {
        // Make sure the pixel is within screen boundaries
        if ((x + j) >= 0 && (x + j) < 320 && (y + i) >= 0 && (y + i) < 240) {
          plot_pixel(scaled_x, scaled_y, 0xA493);
        }
      }
    }
  }
}

bool process_keyboard_input() {
  // Pointer to keyboard data register
  volatile int *keyboard_ptr = (int *)0xFF200100;
  bool spacebar_pressed = false;

  // Read data register in PS/2 port
  int PS2_data = *keyboard_ptr;

  // Extract RVALID to check if data is valid
  int RVALID = (PS2_data & 0x8000);

  // If data is valid, process key code
  if (RVALID != 0) {
    unsigned char key_code = PS2_data & 0xFF;

    if (key_code == PS2_RIGHT_ARROW && taxi_lane == 0) {
      // If right arrow pressed and taxi is in left lane, move to right lane
      taxi_lane = 1;
    } else if (key_code == PS2_LEFT_ARROW && taxi_lane == 1) {
      // If left arrow pressed and taxi is in right lane, move to left lane
      taxi_lane = 0;
    } else if (key_code == PS2_SPACEBAR) {
      // If spacebar pressed, note it but don't immediately jump
      spacebar_pressed = true;
    }
  }

  return spacebar_pressed;
}

bool draw_gameOver(const int gameOver[240][320]) {
  for (int i = 0; i < 240; i++) {
    for (int j = 0; j < 320; j++) {
      if (j >= 0 && j < 320 && i >= 0 && i < 240) {
        plot_pixel(j, i, gameOver[i][j]);
      }
    }
  }

  // Wait for vsync to display it
  wait_for_vsync();

  // Wait for "P" key press
  volatile int *keyboard_ptr = (int *)0xFF200100;
  while (1) {
    // Read data register in the PS/2 port
    int PS2_data = *keyboard_ptr;

    // Extract RVALID to check if data is valid
    int RVALID = (PS2_data & 0x8000);

    // If data is valid, check if it's the Enter key
    if (RVALID != 0) {
      unsigned char key_code = PS2_data & 0xFF;

      if (key_code == PS2_P) {
        //"P" pressed, return true to restart game
        return true;
      }
    }
  }
}

void show_title_screen(const int titlePage[240][320]) {
  // Draw title page
  for (int i = 0; i < 240; i++) {
    for (int j = 0; j < 320; j++) {
      if (j >= 0 && j < 320 && i >= 0 && i < 240) {
        plot_pixel(j, i, titlePage[i][j]);
      }
    }
  }

  // Wait for vsync to display it
  wait_for_vsync();

  // Wait for Enter key press
  volatile int *keyboard_ptr = (int *)0xFF200100;
  while (1) {
    // Read data register in the PS/2 port
    int PS2_data = *keyboard_ptr;

    // Extract RVALID to check if data is valid
    int RVALID = (PS2_data & 0x8000);

    // If data is valid, check if it's the Enter key
    if (RVALID != 0) {
      unsigned char key_code = PS2_data & 0xFF;

      if (key_code == PS2_ENTER) {
        // Enter key pressed, exit the function to start the game
        return;
      }
    }
  }
}

int counter = 0;

int main(void) {
  // Seed random number generator
  srand(time(NULL));

  bool restart_game = true;

  while (restart_game) {
    score = 0;
    display_score_on_hex(score);
    restart_game = false;  // Reset restart flag

    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    VGA_start = pixel_ctrl_ptr;

    // Set front pixel buffer to Buffer 1
    *(pixel_ctrl_ptr + 1) =
        (int)&Buffer1;  // First store the address in the back buffer

    // Now, swap the front/back buffers, to set the front buffer location
    wait_for_vsync();

    // Initialize a pointer to the pixel buffer, used by drawing functions
    pixel_buffer_start = *pixel_ctrl_ptr;

    draw_sky(0x9F7E);
    draw_desert(0xF70A);

    // Set back pixel buffer to Buffer 2
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // Draw on the back buffer

    show_title_screen(titlePage);

    draw_sky(0x9F7E);
    draw_desert(0xF70A);

    // Reset game variables
    int taxi_x = LEFT_LANE; // Start in left lane
    int taxi_y_base = 240 - 80; // Bottom of screen minus taxi height
    int taxi_y = taxi_y_base; // Current y position including jump height
    taxi_lane = 0; // Reset taxi lane to left
    taxi_is_jumping = 0; // Reset jumping state
    taxi_jump_height = 0;
    jump_direction = 1;

    // Variables for road closure position and scaling
    double roadClosure_x_left = 130;  // Center of screen minus half road closure width
    double roadClosure_x_right = 170;  // Center of screen minus half road closure width
    double roadClosure_y_left = 60;        // Start at the top of the road
    double roadClosure_y_right = 60;       // Start at the top of the road
    double roadClosure_scale_left = 0.2;   // Start very small
    double roadClosure_scale_right = 0.2;  // Start very small
    double scale_increment_left = 0.01;  // How much the road closure grows each frame
    double scale_increment_right = 0.01;  // How much the road closure grows each frame
    double lane_scroll_speed_left = 1;   // Matches lane scrolling speed
    double lane_scroll_speed_right = 1;  // Matches lane scrolling speed

    int obstacle_left_active = 0;
    int obstacle_right_active = 0;
    int time_until_next_obstacle = 40;  // Frames until a new obstacle appears
    int obstacle_timer = 0;
    lane_y = 0;  // Reset lane position

    int collision = 0;  // Collision flag

    // Initialize keyboard
    volatile int *keyboard_ptr = (int *)0xFF200100;
    *keyboard_ptr = 0xFF;  // Reset keyboard

    while (!collision) {
      bool spacebar_pressed = process_keyboard_input();

      if (taxi_lane == 0) {
        taxi_x = LEFT_LANE;
      } else {
        taxi_x = RIGHT_LANE;
      }

      // Jump animation
      if (taxi_is_jumping) {
        taxi_jump_height += jump_speed * jump_direction;

        if (taxi_jump_height >= max_jump_height) {
          jump_direction = -1;
          draw_desert(0xF70A);
        }

        if (taxi_jump_height <= 0 && jump_direction == -1) {
          taxi_jump_height = 0;
          taxi_is_jumping = 0;
          jump_direction = 1;
          draw_desert(0xF70A);
        }

        taxi_y = taxi_y_base - taxi_jump_height;
        draw_desert(0xF70A);
      } else {
        taxi_y = taxi_y_base;
      }

      if (!taxi_is_jumping) {  // Check collisions if not jumping
        // Check left lane obstacle
        if (obstacle_left_active && taxi_lane == 0) {
          int obstacle_height = (int)(57 * roadClosure_scale_left);
          int obstacle_width = (int)(80 * roadClosure_scale_left);

          // First check if obstacle is in jump zone
          bool in_jump_zone = (roadClosure_y_left + obstacle_height > taxi_y - JUMP_ZONE_DISTANCE) && (roadClosure_y_left < taxi_y);

          // Process spacebar press in jump zone
          if (in_jump_zone && *keyboard_ptr & 0x8000) {
            unsigned char key_code = *keyboard_ptr & 0xFF;
            if (key_code == PS2_SPACEBAR) {
              // Remove obstacle
              obstacle_left_active = 0;
              // Increase score
              score++;
              display_score_on_hex(score);
              // Start jump animation
              taxi_is_jumping = 1;
              taxi_jump_height = 0;
              jump_direction = 1; // Moving up
              continue; // Skip rest of loop to avoid collision
            }
          }

          // Check for regular collision
          if (roadClosure_y_left + obstacle_height > taxi_y &&
              roadClosure_y_left < taxi_y + 68) {
            collision = 1;
          }
        }

        // Check right lane obstacle
        if (obstacle_right_active && taxi_lane == 1) {
          int obstacle_height = (int)(57 * roadClosure_scale_right);
          int obstacle_width = (int)(80 * roadClosure_scale_right);

          // First check if obstacle is in jump zone
          bool in_jump_zone = (roadClosure_y_right + obstacle_height > taxi_y - JUMP_ZONE_DISTANCE) && (roadClosure_y_right < taxi_y);

          // Process spacebar press in jump zone
          if (in_jump_zone && *keyboard_ptr & 0x8000) {
            unsigned char key_code = *keyboard_ptr & 0xFF;
            if (key_code == PS2_SPACEBAR) {
              // Remove obstacle
              obstacle_right_active = 0;
              // Increase score
              score++;
              display_score_on_hex(score);
              // Start jump animation
              taxi_is_jumping = 1;
              taxi_jump_height = 0;
              jump_direction = 1; // Moving up
              continue; // Skip rest of loop to avoid collision
            }
          }

          // Check for regular collision
          if (roadClosure_y_right + obstacle_height > taxi_y &&
              roadClosure_y_right < taxi_y + 68) {
            collision = 1;
          }
        }
      }

      // Erase anything that was drawn in prev iteration
      draw_road(0xF70A);
      draw_lanes(0xA493);
      erase_taxi(taxi_x, taxi_y_base - taxi_jump_height, taxi);

      if (obstacle_left_active) {
        erase_scaled_roadClosure(roadClosure_x_left, roadClosure_y_left, roadClosure, roadClosure_scale_left);
      }

      if (obstacle_right_active) {
        erase_scaled_roadClosure(roadClosure_x_right, roadClosure_y_right, roadClosure, roadClosure_scale_right);
      }

      draw_road(0xA493);
      draw_lanes(0xFFFF);

      obstacle_timer++;
      if (obstacle_timer >= time_until_next_obstacle) {
        // Time to possibly generate a new obstacle
        int new_obstacle_lane = rand() % 2;  // 0 for left, 1 for right

        // Increase the score when new obstacle is generated
        display_score_on_hex(score);

        if (new_obstacle_lane == 0 && !obstacle_left_active) {
          // Create left lane obstacle
          obstacle_left_active = 1;
          roadClosure_y_left = 60;
          roadClosure_scale_left = 0.2;
        } else if (new_obstacle_lane == 1 && !obstacle_right_active) {
          // Create right lane obstacle
          obstacle_right_active = 1;
          roadClosure_y_right = 60;
          roadClosure_scale_right = 0.2;
        }

        // Reset timer and set random time until next obstacle
        obstacle_timer = 0;
        time_until_next_obstacle =
            150 + (rand() % 100);  // Random between frames
      }

      // Update and draw left lane obstacle if active
      if (obstacle_left_active) {
        roadClosure_y_left += lane_scroll_speed_left;
        roadClosure_scale_left += scale_increment_left;
        if (roadClosure_scale_left > MAX_OBSTACLE_SCALE) {
          roadClosure_scale_left = MAX_OBSTACLE_SCALE;
        } else {
          roadClosure_x_left--;
        }
        draw_scaled_roadClosure(roadClosure_x_left, roadClosure_y_left, roadClosure, roadClosure_scale_left);

        // Reset if off screen
        if (roadClosure_y_left > 240) {
          obstacle_left_active = 0;
          ++score;
        }
      }

      // Update and draw right lane obstacle if active
      if (obstacle_right_active) {
        roadClosure_y_right += lane_scroll_speed_right;
        roadClosure_scale_right += scale_increment_right;
        if (roadClosure_scale_right > MAX_OBSTACLE_SCALE) {
          roadClosure_scale_right = MAX_OBSTACLE_SCALE;
        }

        draw_scaled_roadClosure(roadClosure_x_right, roadClosure_y_right, roadClosure, roadClosure_scale_right);

        // Reset if off screen
        if (roadClosure_y_right > 240) {
          obstacle_right_active = 0;
        }
      }
      draw_taxi(taxi_x, taxi_y, taxi);

      wait_for_vsync();  // Swap front and back buffers on VGA vertical sync
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // New back buffer
    }

    // If collision detected, go to game over and check for restart
    if (collision) {
      restart_game = draw_gameOver(gameOver);
    }
  }
  return 0;
}